        dots: false,
        infinite: true,
        fade:true,
        speed: 200,
        slidesToShow: 1,
        slidesToScroll: 1,
        accessibility:true,
        dotsClass:"slick-dots",
      };

        return (
          <Slider {...settings}>
            <div>
              <img src={data[0]} alt="ide" className="photo" />
